BEGIN TRANSACTION;
CREATE TABLE "OFFER_PRICE" (
	`ID`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`OFFER_ID`	TEXT,
	`PRICE`	INTEGER,
	`DATE`	TEXT
);
CREATE TABLE "OFFER" (
	`ID`	TEXT,
	`LINK`	TEXT,
	`TITLE`	TEXT,
	`ROOMS`	INTEGER,
	`SURFACE`	REAL,
	`FLOOR`	TEXT,
	`ROOM_STRUCTURE`	TEXT,
	`NEIGHBOURHOOD`	TEXT,
	PRIMARY KEY(ID)
);
COMMIT;
